import React from 'react'
import classes from './MovingLine.module.css'

const MovingLine = () => {
  return (
    <div className={classes.scrollingBanner}>
      <div className={classes.content}>
        <span>KETTLEBELL</span>
        <span>JUMP ROPE</span>
        <span>MEDICINE BALL</span>
      </div>
    </div>
  )
}

export default MovingLine;
